description:
Hannah Montana: The Movie (2009)  

Verenigde Staten
Komedie / Familie
102 minuten

geregisseerd door Peter Chelsom
met Miley Cyrus, Emily Osment en Taylor Swift

Hannah Montana is een populair meisje, wier populariteit steeds groter wordt. Ondertussen is een ander meisje, Miley Steward ingegaan op het dringende verzoek van haar vader: teruggaan naar haar thuis in Crowley Corners, waar ze achter de echte zin van het leven moet komen en waar ze erachter moet komen dat populariteit niet het belangrijkste is.


